import { Button } from './NavigationInst.styled';

export const NavigationInst = ({ i }) => {
  console.log(i);
  return (
    <>
      <ul>
        <li>
          <Button
            type="button"
            onClick={() => {
              i('guit');
            }}
          >
            guitar
          </Button>
        </li>
        <li>
          <Button
            type="button"
            onClick={() => {
              i('ukul');
            }}
          >
            ukulele
          </Button>
        </li>
      </ul>
    </>
  );
};
